<!DOCTYPE html>
<html>
	<head>
		<meta charset="UTF-8">
		<title></title>
<style>
*{padding:0;margin:0;}
.loading{ width:100%;height:100%;position:fixed;top:0;left:0;z-index:100;background: #fff;}
.loading .pic{ width:100px;height:100px;position: absolute;top:0;bottom: 0;left: 0;right:0;margin: auto;font-size: 30px;text-align: center;line-height: 100px;}
.loading .pic span{ display:block;width:80px;height:80px;position: absolute;top:10px;left:10px;box-shadow:0 3px 0 #666;
border-radius: 50%;-webkit-animation: rotate 1px infinite linear;animation: rotate 1s infinite linear;}
@keyframes rotate{
	0%  { transform: rotate(0deg);}
	100%{ transform: rotate(360deg);}
}

@-webkit-keyframes rotate{
	0%  { transform: rotate(0deg);}
	100%{ transform: rotate(360deg);}
}
</style>
<script  src="js/jquery-1.11.1.js"></script>
<script>
	$(function(){
		var img = $("img");
		var num=0;
		img.each(function(i){
			var OImg = new Image();
			OImg.onload=function(){
				OImg.onload=null;
				num++;
				$(".loading b").html(parseInt(num/$("img").size()*100)+"%");
				if(num>=i){
					$(".loading").fadeOut();
				}
			}
			OImg.src=img[i].src;
		});
	});
</script>
